import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";

import CHAT from "./components/chat/CHAT";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<CHAT />} />
      </Routes>
    </Router>
  );
}

export default App;
